import React, { useState } from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import './App.css';


const App = () => (
  <Container fluid>
    <Row>
      <Col style={{background:"red", width:"25px"}}>1 of 2</Col>
      <Col style={{background:"black", width:"75px"}}>2 of 2</Col>
    </Row>
    <Row>
      <Col>1 of 3</Col>
      <Col>2 of 3</Col>
      <Col>3 of 3</Col>
    </Row>
  </Container>
);

export default App;
